import React from "react";
import {Link} from "react-router-dom"

import MyAccount_icon from '../../1_image_or_icon/KakaoTalk_20230305_172729349_03.jpg'

const Personalized_data_progresser = (props) => {

    switch(typeof props){

        case ('object'): return <React.Fragment>
            <div id="Personalized_data_TabNevbar_Container">
            <Link className="Personalized_data_TabButton" to='/account'>
            {/* <img className="Personalized_data_TabIcon" src={MyAccount_icon}></img> */}
            My Account
            </Link>
            <Link className="Personalized_data_TabButton" to='/reviews'>My Reviews</Link>
            <Link className="Personalized_data_TabButton" to='/journals'>My Journals</Link>
            <Link className="Personalized_data_TabButton" to='/alarms'>Alarms</Link>
            <Link className="Personalized_data_TabButton" to='/options'>Options</Link>
            </div>
        </React.Fragment>

        case ('undefined'): return 'none';
    }

}

export default Personalized_data_progresser;
